import React, { useState } from "react";
import "./componentStyles/SelectSearch.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faAngleDown, faSearch } from "@fortawesome/free-solid-svg-icons";

const SelectSearch = () => {
  const [filters, setFilters] = useState([]);

  const submitSearch = (params) => {
    setFilters();
  };
  return (
    <div className="selectSearch-container">
      <form className="form-container" onSubmit={submitSearch}>
        <select>
          <option>Used Cars</option>
        </select>
        <FontAwesomeIcon icon={faAngleDown} />
        <hr />
        <select>
          <option>Any Makes</option>
        </select>
        <FontAwesomeIcon icon={faAngleDown} />
        <hr />
        <select>
          <option>Any Models </option>
        </select>
        <FontAwesomeIcon icon={faAngleDown} />
        <hr />
        <select>
          <option>All Prices</option>
        </select>
        <button type="submit">
          <FontAwesomeIcon icon={faSearch} />
        </button>
      </form>
    </div>
  );
};

export default SelectSearch;
